 <text align=\"left\" length=\"10\">Total paid</text>\r\n            <text align=\"right\" length=\"10\">${ticket.printTotalPaid()}</text>\r\n        </line>\r\n        <line>\r\n            <text align=\"center\" length=\"20\">Thank You for your custom</text>\r\n        </line>\r\n    </display>\r\n    <ticket>\r\n        <image>Printer.Ticket.Logo</image>\r\n        <line></line>\r\n        <line>\r\n            <text align=\"center\" length=\"42\">Printer.CustomerPaid</text>\r\n        </line>\r\n        <line>\r\n            <text align=\"center\" length=\"42\">You can change this template</text>\r\n        </line>\r\n        <line>\r\n            <text align=\"center\" length=\"42\">in the Resources panel</text>\r\n        </line>\r\n        <line></line>\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Receipt:</text>\r\n            <text>${ticket.printId()}</text>\r\n        </line>\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Date:</text>\r\n            <text>${ticket.printDate()}</text>\r\n        </line>\r\n        \r\n        #if ($ticket.getCustomer())\r\n            <line>\r\n                <text align=\"left\" length=\"15\">Account:</text>\r\n                <text>${ticket.getCustomer().printTaxid()}</text>\r\n            </line>\r\n            <line>\r\n                <text align=\"left\" length=\"15\">Customer:</text>\r\n                <text>${ticket.getCustomer().printName()}</text>\r\n            </line>\r\n\r\n        #end\r\n\r\n        <line></line>\r\n        <line size=\"1\">\r\n            <text align =\"left\" length=\"32\" bold=\"true\">Total Paid</text>\r\n            <text align =\"right\" length=\"10\" bold=\"true\">${ticket.printTotalPaid()}</text>\r\n        </line>\r\n        <line></line>\r\n        <line>\r\n            <text align =\"left\" length=\"32\" bold=\"true\">Account Balance</text>\r\n            <text align =\"right\" length=\"10\" bold=\"true\">${customer.printCurDebt()}</text>\r\n        </line>\r\n\r\n    #foreach ($paymentline in $ticket.payments)\r\n        #if ($paymentline.name == \"cash\")\r\n            <line></line>\r\n            <line>\r\n                <text bold=\"true\">Cash</text>\r\n            </line>\r\n            <line>\r\n                <text align=\"left\" length=\"22\">Tendered:</text>\r\n                <text align =\"right\" length=\"20\">${paymentline.printPaid()}</text>\r\n            </line>\r\n            <line>\r\n                <text align=\"left\" length=\"22\">Change:</text>\r\n                <text align =\"right\" length=\"20\">${paymentline.printChange()}</text>\r\n            </line>\r\n        #end\r\n\r\n        #if ($paymentline.name == \"magcard\")\r\n            <line></line>\r\n            <line>\r\n                <text bold=\"true\">Mag card</text>\r\n            </line>\r\n            <line>\r\n            <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n            </line>\r\n            <line>\r\n                <text align =\"left\" length=\"22\">Number:</text>\r\n                <text>${paymentline.printCardNumber()}</text>\r\n            </line>\r\n            <line>\r\n                <text align =\"left\" length=\"22\">Expiry Date:</text>\r\n                <text>${paymentline.printExpirationDate()}</text>\r\n            </line>\r\n            <line>\r\n                <text align =\"left\" length=\"22\">Operation:</text>\r\n                <text>${paymentline.printTransactionID()}</text>\r\n            </line>\r\n            <line>\r\n                <text align =\"left\" length=\"22\">Authorization:</text>\r\n                <text>${paymentline.printAuthorization()}</text>\r\n            </line>\r\n        #end\r\n\r\n        #if ($paymentline.name == \"cheque\")\r\n            <line></line>\r\n            <line>\r\n                <text bold=\"true\">Cheque</text>\r\n            </line>\r\n            <line>\r\n                <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n            </line>\r\n        #end\r\n\r\n        #if ($paymentline.name == \"voucherin\")\r\n            <line></line>\r\n            <line>\r\n                <text bold=\"true\">Voucher</text>\r\n            </line>\r\n            <line>\r\n                <text align =\"right\" length=\"42\">${paymentline.printTotal()}</text>\r\n            </line>\r\n        #end\r\n    #end\r\n       <line></line>\r\n        <line>\r\n            <text align=\"left\" length=\"15\">Cashier:</text>\r\n            <text>${ticket.printUser()}</text>\r\n        </line>\r\n        <line></line>\r\n        <line>\r\n            <text align=\"center\" length=\"42\">Thank You for your custom</text>\r\n        </line>\r\n    </ticket>\r\n\r\n    #foreach ($paymentline in $ticket.payments)\r\n        #if ($paymentline.name == \"cash\")\r\n            <opendrawer/>\r\n        #end\r\n    \r\n        #if ($paymentline.name == \"cashrefund\")\r\n            <opendrawer/>\r\n        #end\r\n    #end\r\n</output>'),('29','Printer.CustomerPaid2',0,_binary '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\n<!-- \n    uniCenta oPOS - Touch friendly Point Of Sale\n    Copyright (c) 2009-2017 uniCenta.\n    http://sourceforge.net/projects/unicentaopos\n\n    This file is part of uniCenta oPOS.\n\n    uniCenta oPOS is free software: you can redistribute it and/or modify\n    it under the terms of the GNU General Public License as published by\n    the Free Software Foundation, either version 3 of the License, or\n    (at your option) any later version.\n\n    uniCenta oPOS is distributed in the hope that it will be useful,\n    but WITHOUT ANY WARRANTY; without even the implied warranty of\n    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n    GNU General Public License for more details.\n\n    You should have received a copy of the GNU General Public License\n    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n -->\n<output>\n    <display>\n        <line>\n            <text align=\"left\" length=\"10\">Total Paid</text>\n            <text align=\"right\" length=\"10\">${ticket.printTotalPaid()}</text>\n        </line>\n        <line>\n            <text align=\"center\" length=\"20\">Thank You for your custom</text>\n        </line>\n    </display>\n</output>'),('3','coin.05',1,_binary '‰PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0@\0\0\0?\0\0\0P\Î\Ê\0\0\0gAMA\0\0±üa\0\0\0	pHYs\0\0\Â\0\0\Â(J€\0\0\0\ZtEXtSoftware\0Paint.NET v3.5.100ôr¡\0\0+IDATx^\å›!wW…SVšŸ\è¿hXZhXZXhjXhhjXhj¨¾;šorwôv%9ršs\êstVZ­v\ßÜ™¹sgvı\Ën·{ó¿ş\0ÿ\ç\×3ş\ë\×\ç7_ŸwOOO»‡Ç‡\İııı\îş\î\ï\İ\í\ç\Ïß¶cŸ¾\Ó1:V¯\×vÎ« dŒüô\ç_»\ë\ë\ß_}7\×ûm¼ÿ8^77»\ÛÛ»\0\êññi\'\0_Œ‹Ÿô\Ë\×]-ƒeD3Œ\ã}\ìû>\İ~Šcd ¶ñ9÷i«\ãÿ\Ècõ>Ct\\\nŒ‹ =\Ü?…qW\ï\ß\í\rÎ—qƒe´@\"\ÜyO´\È\ã:^‘‘[¢CŸ\Ä%@¸\0ZŒ<$Ã¯GH+tµXmõ\Ò÷2\ê\áùK¼Ç‹±µ|~\Zy?>0#ÿõ9¸BQ2\0\ÑV€	\Ì÷ò\Äw o\à\ày\Û\r\r“õ0@\0\0\"(:¦ÀPD‘Jc«\È\Ù=¿¬š½\0åº¼ ¯“¿\nõbp<kvoC\ä·3?\Ç	€Æ–rğµ\ï%)ñ\"\0´XXSˆ»G©¤%aT¾\'\× ¼ˆÁlõ}_ş†óFJe9\r²|aJœ\r€.J\âùE(cŠ¼\ãF\Ë(7P\ïe„HS[r\ŞÃj¢ó\Í\0Uª„HS\âºgè‡³\0\Ğ\"ò°²‹ò;Jš¥†óı\È\ÕX ‘ s\Ô\ç\ÜPŸ\ïöMğ0[zÁ\r: œªN@‹\ç\İ@‚ax›”À3#\ÃC\É\Z^’Ğ³ı|¯myw\Ô~\"d‘\"\r„¨D*£\ê(ª”:§D\ÂI\0È¸búqTáš²•\Ï\Ôüd\ç2\\\ÄY ¤\áxŸ\ÈXD\Üa¥\Ñù¡H\ÕøAÀS†\ãúGz“\0@\Æjº0W˜¢\ç:&<F\ã\éğúøÃAC@¹w·¢\î\àº]G–”\Éc‚\é(\0”\Z1-ƒ§µ\í\ë\0¸±:¦B>C?ŒÀhñ”A\0«”±4qp\\\à\âˆ\äÒ¯Î½AŠ›\0\ÈPdmä”«¶öMŠöi!‹ü\Ä\ë{g—\Ç\íc½¥¦;H\ÚJŠeAx •ü6Ra¼ \íµT\Ø\0\Ù\É\"½!…¢.\ä„V0±X,iœF(g½¢”ñ	$\×u‘\É];p¬Òªš²AŠk©°\n\0b$½T‘\×Ú‚z\åÿ\ÄûZùB(S‹ù€€MöşFY1<2º\á³Ï¤gô%rÒ„W \Õ½–;Ñ‘\Ë[9\ïA@·ç€¿\ìCD-¢ˆt \"¬š@Æ½„òY©+[\é„)\0\ã\Ço\è\æ\ä‘º©ñ\Z\ÛY¾úTW£ñI-xÁ“J\â).bºT\Ú$U©®!{fı\Â\0˜_Æ»¡B³3n\Ô\íY\Ø\ï\Éñ7cp†\"0zEÀø%Ä·®%x|0\Ö\0*\åª!\Ì\0¶‹£)\0BKyZ¬Ÿ\ÊxL\ß)—ê®³ö\n’\ëÌ°)\âM\ÂZhOT¤GC­¹;‰J%»:\0  \r\nBÄ„~G\è\ìklü\Âj\åAÇ‚ù 5\Ú\'GŒÁğ8¿\ës\ç\ÈYQ0\ë+\Ø/[®>¼;Hƒ\0Œ,a’gj7PûiMuñşW¹šcM†ó³J¢\×O¯–—ôYy\ìü ¨ˆh/\'\Â\0˜\ê/\åıñ+¿ /\r?vD\'\ëúb\İ C‹A?R1I¢\ìD‘›€EtÍ¢À«Õ¢l§X£‹=À\ÈsPxƒ