ral Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n// This script lets you add a note to a sales transaction line\r\n\r\nindex = sales.getSelectedIndex(); \r\nif (index >= 0) {   \r\n    line = ticket.getLine(index);   \r\n    value = javax.swing.JOptionPane.showInputDialog(\"Line notes\", line.getProperty(\"notes\")); \r\n    if (value != null) { \r\n        // the user pressed OK \r\n        line.setProperty(\"notes\", value); \r\n    } \r\n}'),('54','script.Event.Total',0,_binary '// script.Event.Total\r\n// This script requires ALL flagged Remote Printer items to be sent to Remote Printer before Payment\r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2017 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n\r\n\r\nfor(int i= 0; i < ticket.getLinesCount(); i++){\r\n	line = ticket.getLine(i);\r\n	if ($ticketline.isProductKitchen()){\r\n		line.setProperty(\"sendstatus\", \"No\");\r\n	}\r\n	if(line.getProperty(\"sendstatus\").equals(\"No\")){\r\n		mySent = \"No\";\r\n	}\r\n}\r\n\r\nif (mySent == \"No\"){\r\n	javax.swing.JOptionPane.showMessageDialog(null, \"Before closing ticket: Please Send Order to Remote Printer\", \"Send Check\", JOptionPane.WARNING_MESSAGE);\r\n	return \"Cancel\";\r\n}else{\r\n	return null;\r\n}'),('55','script.Keyboard',0,_binary '// script.Keyboard.txt\r\n// This script launches uniCenta Virtual Keyboard\r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2017 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n\r\nRuntime runtime = Runtime.getRuntime();\r\nProcess proc = runtime.getRuntime() .exec(\"cmd /C start plugins/uni_scrn_kb.jar\");'),('56','script.linediscount',0,_binary '// script.linediscount\n//\n//    uniCenta oPOS - Touch Friendly Point Of Sale\n//    Copyright (c) 2009-2017 uniCenta\n//    http://sourceforge.net/projects/unicentaopos\n//\n//    This file is part of uniCenta oPOS.\n//\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\n//    it under the terms of the GNU General Public License as published by\n//    the Free Software Foundation, either version 3 of the License, or\n//    (at your option) any later version.\n//\n//    uniCenta oPOS is distributed in the hope that it will be useful,\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\n//    GNU General Public License for more details.\n//\n//    You should have received a copy of the GNU General Public License\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\n// **************************************************************************\n// This script applies UsersInput %Discount for the Item Line value\n// To use in the sales screen: Highlight the line you want to discount\n// Then Tap in the %Discount amount and touch the blue % button\n\nimport com.openbravo.format.Formats;\nimport com.openbravo.pos.ticket.TicketLineInfo;\nimport com.openbravo.pos.ticket.TicketProductInfo;\n\ndiscountrate = sales.getInputValue()/100;\n\nindex = sales.getSelectedIndex();\nif (index >= 0) {\n    line = ticket.getLine(index);\n    if (line.getPrice() > 0.0 && discountrate > 0.0) {\n\n        sdiscount = Formats.PERCENT.formatValue(discountrate);\n        ticket.insertLine(index + 1,\n            new TicketLineInfo(\n                    \"Line Discount \" + sdiscount,\n                    line.getProductTaxCategoryID(),\n                    line.getMultiply(),\n                    -(double)((line.getPriceTax() * discountrate * 100) / (1+line.getTaxRate()))/100,\n                    line.getTaxInfo()));\n        sales.setSelectedIndex(index + 1);\n    } else {\n         java.awt.Toolkit.getDefaultToolkit().beep();\n    }\n} else {\n    java.awt.Toolkit.getDefaultToolkit().beep();\n}'),('57','script.ReceiptConsolidate',0,_binary '// script.ReceiptConsolidate\r\n// Remove duplicate item entries and ADD\'s Units to first entry of the item\r\n// This script only consolidates items with a valid ProductID \r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2017 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n\r\nimport com.openbravo.format.Formats;\r\nimport com.openbravo.pos.ticket.TicketLineInfo;\r\nimport com.openbravo.pos.ticket.TicketInfo;\r\nimport com.openbravo.pos.ticket.TicketProductInfo; \r\nimport java.util.Properties;\r\n\r\nint numlines = ticket.getLinesCount(); \r\n\r\nfor (int i = 0 ; i < numlines ; i++) {  \r\n 	current_ticketline = ticket.getLine(i);\r\n	current_unit  = current_ticketline.getMultiply();\r\n	if ( current_unit != 0){\r\n		for (int j = i + 1 ; j < numlines ; j++) {\r\n			if ( ticket.getLine(j).getProductID() != null) {\r\n				loop_ticketline = ticket.getLine(j);\r\n				loop_unit  = loop_ticketline.getMultiply();  \r\n 				String current_productid = current_ticketline.getProductID();\r\n				String loop_productid    = loop_ticketline.getProductID();\r\n\r\n				if ( loop_productid.equals(current_productid) && (loop_ticketline.getPrice() == current_ticketline.getPrice()) && (loop_unit != 0) ){\r\n					current_unit = current_unit + loop_unit;\r\n					loop_ticketline.setMultiply(0);	\r\n				}\r\n			}	\r\n		}\r\n	current_ticketline.setMultiply(current_unit);\r\n	}	\r\n }\r\n\r\n\r\n// now remove the ticket lines where the unit = 0\r\n// start deleteing in reverse order\r\n\r\nfor (int i = numlines - 1 ; i > 0 ; i--) { \r\n	loop_ticketline = ticket.getLine(i);\r\n	loop_unit  = loop_ticketline.getMultiply();\r\n	if (loop_unit == 0){\r\n		ticket.removeLine(i);\r\n		\r\n	}\r\n} '),('58','script.Refundit',0,_binary '// script.Refundit.txt\r\n// This script allows an item to be Refunded (or Returned/Exchanged) within a Sale\r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2017 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n\r\n\r\nimport java.util.Properties;\r\nimport com.openbravo.format.Formats;\r\nimport com.openbravo.pos.ticket.TicketLineInfo;\r\nimport com.openbravo.pos.ticket.TicketProductInfo;\r\n\r\n    index = sales.getSelectedIndex();\r\nif (index >= 0) {\r\n	for (int i= 0; i < ticket.getLinesCount(); i++) {\r\n        	row = ticket.getLine(i);\r\n	        double value = -1.0;\r\n        	row.setMultiply(value);\r\n\r\n	ticket.ticketType = 1;\r\n       }\r\n}'),('59','script.SendOrder',0,_binary '// script.SendOrder\r\n// Sends an item in a Sale to a remote Printers\r\n//\r\n//    uniCenta oPOS - Touch Friendly Point Of Sale\r\n//    Copyright (c) 2009-2017 uniCenta\r\n//    http://sourceforge.net/projects/unicentaopos\r\n//\r\n//    This file is part of uniCenta oPOS.\r\n//\r\n//    uniCenta oPOS is free software: you can redistribute it and/or modify\r\n//    it under the terms of the GNU General Public License as published by\r\n//    the Free Software Foundation, either version 3 of the License, or\r\n//    (at your option) any later version.\r\n//\r\n//    uniCenta oPOS is distributed in the hope that it will be useful,\r\n//    but WITHOUT ANY WARRANTY; without even the implied warranty of\r\n//    MERCHANTABILITY or FITNESS FOR A PARTICULAR PURPOSE.  See the\r\n//    GNU General Public License for more details.\r\n//\r\n//    You should have received a copy of the GNU General Public License\r\n//    along with uniCenta oPOS.  If not, see <http://www.gnu.org/licenses/>.\r\n// **************************************************************************\r\n\r\nprivate boolean printedP1 = false;\r\nprivate boolean printedP2 = false;\r\nprivate boolean printedP3 = false;\r\nprivate boolean printedP4 = false;\r\nprivate boolean printedP5 = false;\r\nprivate boolean printedP6 = false;\r\n\r\nfor(int i= 0; i < ticket.getLinesCount(); i++){\r\n    line = ticket.getLine(i);\r\n\r\n    if (line.getProperty(\"product.printer\")!=null) {\r\n\r\n        if (line.getProperty(\"product.printer\").equals(\"1\")) {\r\n            if((printedP1 == false) && line.getProperty(\"updated\").equals(\"true\")) {\r\n                sales.printTicket(\"Printer.Ticket.P1\"); \r\n                printedP1 = true;\r\n            }\r\n        }\r\n\r\n        if (line.getProperty(\"product.printer\").equals(\"2\")) {\r\n            if((printedP2 == false) && line.getProperty(\"updated\").equals(\"true\")){\r\n                sales.printTicket(\"Printer.Ticket.P2\"); \r\n                printedP2 = true;\r\n            }\r\n        }\r\n        if (line.getProperty(\"product.printer\").equals(\"3\")) {\r\n            if((printedP3 == false) && line.getProperty(\"updated\").equals(\"true\")){\r\n                sales.printTicket(\"Printer.Ticket.P3\"); \r\n                printedP3 = true;\r\n            }\r\n        }\r\n\r\n        if (line.getProperty(\"product.printer\").equals(\"4\")) {\r\n            if((printedP4 == false) && line.getProperty(\"updated\").equals(\"true\")){\r\n                sales.printTicket(\"Printer.Ticket.P4\"); \r\n                printedP4 = true;\r\n            }\r\n        }\r\n        if (line.getProperty(\"product.printer\").equals(\"5\")) {\r\n            if((printedP5 == false) && line.getProperty(\"updated\").equals(\"true\")){\r\n                sales.printTicket(\"Printer.Ticket.P5\"); \r\n                printedP5 = true;\r\n            }\r\n        }\r\n\r\n        if (line.getProperty(\"product.printer\").equals(\"6\")) {\r\n            if((printedP6 == false) && line.getProperty(\"updated\").equals(\"true\")){\r\n                sales.printTicket(\"Printer.Ticket.P6\"); \r\n                printedP6 = true;\r\n            }\r\n        }\r\n    }\r\n}'),('6','coin.2',1,_binary '‰PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0@\0\0\0@\0\0\0ªiq\Ş\0\0\0gAMA\0\0±üa\0\0\0	pHYs\0\0\Â\0\0\Â(J€\0\0\0\ZtEXtSoftware\0Paint.NET v3.5.100ôr¡\0\0(`IDATx^\å{wP\ä\ç™f\ï^\Õ]]\Õ\Öİ•w\×á¼µ®ºò\ïy½>\Ëë³­µ-­¼–ƒ\Ò*\Ï(Œ4A3LN0‰0\äCÎ¹¡›&5±¡\É\r4\ĞtCM\Î9\ÃŸ{¾\ßX²µ¶dÉ–ÿ:¦(†Nü¾÷{\ß\ç}\ç{@öÿõ—Àóû\è\èP¶µ¾.[š\è‘\r•²\Ş\Ê(˜Ka)õ@o±J\Üa)r\ãÿ\İ0Ôœ\"\éÌ—\Í\Ö\Ë6—&d\â½À\Ñõúş(~x°/[3\Ëz\Ê\ÃÑ¡rFşUt«\İÑtŠû\ÏAyûgx÷q<8÷\"œ@\ÌÅ§ö\Şy\é\ÇP¸?m\Èq´È¯¡7÷z+\Â1Ç€<d@>û`|¦\Ø\ßİ‘\rw(eù\r–{ >ş<O>\è+O£)\çª3\Ü\ÑS„~mÚ”wQ\Zq•1— M¸u\Èi4\É\ï :ù\ì5(»Š˜k/ €\ï—3(ºŒ«¬ğÁòdƒ±÷™]÷gòA{·ee°ºÁ¢öD\äù\'‘\êò,5IhŠƒ^\é†N•+lE\îhd”EœF¢ó/ø\ŞOp÷•Ç\ïÿ&J‚\ßEøÅ§‘x±W~Œ\Æ\ä‹hN»u\è;Pú¼üÀp;ömxüı%÷°0\Ò,;8\Øıƒ¯ÿú\0±pKuîŠ2¸¾