urce;\nimport com.openbravo.pos.payment.PaymentInfo;\nimport javax.swing.JOptionPane;\nimport javax.swing.JDialog;\n\n\nboolean isCash = false;\nString change = \"\";\nPaymentInfo p = ticket.payments.getFirst();\n\nif (\"cash\".equals(p.getName())) {\n    isCash = true;\n    change = p.printChange();\n}\n\n// Get details of the original font before we change it otherwise all dialogboxes will use new settings\nJOptionPane pane = new JOptionPane();\nFont originalFont=pane.getFont();\n\nUIManager.put(\"OptionPane.buttonFont\", new FontUIResource(new Font(\"ARIAL\",Font.PLAIN,20)));\nmessage = \"Change: \" + change;\n JLabel FontText = new JLabel(message);\n FontText.setFont (new Font ( \"Arial\", Font.BOLD, 36) );\n\nif(isCash) {\n     JOptionPane pane = new JOptionPane();\n     pane.setMessage(FontText);\n     pane.setPreferredSize( new Dimension(450,150));\n     JDialog dialog = pane.createDialog(\"Cash payment\");\n    new Thread(new Runnable() {\n         void run() {\n            dialog.show();\n        }\n    }).start();\n}\n\n// Return to default settings\nUIManager.put(\"OptionPane.buttonFont\", new FontUIResource(new Font(originalFont.getName(),originalFont.getStyle(),originalFont.getSize())));'),('69ecc299-a439-4351-91a0-d5dd6ffc30da','LIXA\'s STORE/properties',0,_binary '<?xml version=\"1.0\" encoding=\"UTF-8\"?>\r\n<!DOCTYPE properties SYSTEM \"http://java.sun.com/dtd/properties.dtd\">\r\n<properties>\r\n<comment>uniCenta oPOS</comment>\r\n<entry key=\"location\">0</entry>\r\n<entry key=\"activecash\">eb15f787-ace3-4936-919d-2303ae3291c7</entry>\r\n</properties>\r\n'),('7','coin.20',1,_binary '‰PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0@\0\0\0?\0\0\0P\Î\Ê\0\0\0gAMA\0\0±üa\0\0\0	pHYs\0\0.\"\0\0.\"ª\âİ’\0\0\0\ZtEXtSoftware\0Paint.NET v3.5.100ôr¡\0\0\"iIDATx^µ[÷s]\çq…\ì?$3\É™qg’\í\ÈÙ’œq“¬f\ÉT¡D‘\"\ÅN`E!\n\ÑA…hD\ï½÷\Ş{\ï½w\0‰^ˆ\Í9ûxišCf@GÁÌû\ŞÃ»÷~»\ßÙ³g÷û\Ş\"böCş˜½ñ\Æzğ÷şµñÙ~ô#ı?¿o¼~ò\ä‰Ùüc½†‡ñ¹1¾\ç\ïõü˜k\ïoŒ\í\Ù‡ıg>hww×Œg\Z\È{\ï\ï\ï?{ıü³ŒÿŸ\í\í\í\ë÷